import {
  Typography,
  Menu,
  Layout,
  theme,
  Avatar,
  Badge,
  MenuProps,
  Space,
} from "antd";
import React from "react";
import { toAbsoluteUrl } from "../../helpers";
import { BellOutlined, UserOutlined } from "@ant-design/icons";

type Props = {};
const { Header, Content } = Layout;

const HeaderNav = (props: Props) => {
  const {
    token: { colorBgContainer },
  } = theme.useToken();

  const items1: MenuProps["items"] = [
    {
      key: "notification",
      icon: (
        <Space size="small">
          <Badge dot={true}>
            <Avatar
              icon={<BellOutlined style={{ fontSize: "23px" }} />}
              shape="square"
              size={"small"}
              style={{ backgroundColor: colorBgContainer, color: "black" }}
            />
          </Badge>
        </Space>
      ),
    },
    {
      key: "profile",
      icon: (
        <Space size="small">
          <Avatar
            src={toAbsoluteUrl("/media/logos/profileAvatar.svg")}
            shape="square"
            size={"default"}
            style={{ backgroundColor: colorBgContainer, color: "black" }}
          />
        </Space>
      ),
      label: (
        <label
          style={{
            fontSize: "16px",
            fontStyle: "normal",
            lineHeight: "22px",
            fontWeight: "450",
          }}
        >
          User U
        </label>
      ),
    },
  ];
  return (
    <Header
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        background: colorBgContainer,
        position: "sticky",
        top: 0,
        zIndex: 1,
        width: "100%",
      }}
    >
      <div
        className="demo-logo"
        style={{
          display: "flex",
          flexDirection: "column",
          marginTop: "5px",
          justifyContent: "end",
        }}
      >
        <img
          alt="Logo"
          className="h-5px logo"
          src={toAbsoluteUrl("/media/logos/oak full.svg")}
        />
        <Typography
          style={{
            fontStyle: "bold",
            fontSize: "14px",
            fontWeight: "600",
            lineHeight: "24px",
            color: "#396A98",
          }}
        >
          Google KE
        </Typography>
      </div>
      <Menu
        theme="light"
        mode="horizontal"
        defaultSelectedKeys={["notification"]}
        items={items1}
        style={{ justifyContent: "end", alignItems: "center" }}
      />
    </Header>
  );
};

export default HeaderNav;
